  `fopenid` varchar(100) NOT NULL,
  `zsw` varchar(100) NOT NULL,
  `ydf` varchar(200) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `username` (`username`),
  KEY `email` (`email`),
  KEY `mobile` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='会员表';
